import React from 'react';
import './boxmessage.css';

const BoxMessage = () => {
	return (
		<div>
			<div className="align-self-center card-container">
				<div className="card rgba-blue-slight">
					<div className="card-body">
						<i className="d-flex justify-content-end fas fa-times-circle cc_pointer"></i>
						<p className="card-text">
							Some quick example text to build on the panel title and make up the bulk of the panel's
							content. Some quick example text to build on the panel title and make up the bulk of the
							panel's content.
						</p>
					</div>
				</div>
			</div>
		</div>
	);
};

export default BoxMessage;
